import * as React from 'react';
import { useContext } from 'react'
import { styled, alpha } from '@mui/material/styles';
import { useSpring, animated } from 'react-spring'
import Divider from '@mui/material/Divider';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
/* import Carousel from "react-material-ui-carousel"; */
import jewelry1 from '../images/jewelery1.jpg'
import jewelry2 from '../images/jewelery2.jpg'
import jewelry3 from '../images/jewelery3.jpg'
import jewelry4 from '../images/jewelery4.jpg'
import jewelry5 from '../images/jewelery5.jpg'
import jewelry6 from '../images/jewelery6.jpg'
import { Parallax, ParallaxLayer } from '@react-spring/parallax'

function LandingPage() {
  const props = useSpring({ to: { opacity: 1 }, from: { opacity: 0 }, delay: 200 })
  return (
    <Box  sx={{display:"flex", flexDirection:"column"}}>

      <Box className="box" sx={{display: 'flex', width: "70vw", justifyContent: 'space-evenly', mx: "auto", mt: 1, mb:2}}>  
          <Box>
            <Typography>Men</Typography>
          </Box>
          <Box>
            <Typography>Women</Typography>
          </Box>
          <Box>
            <Typography>Jewelry</Typography>
          </Box>
          <Box>
            <Typography>Electronics</Typography>
          </Box>
      </Box>

      <Divider/>
      <animated.div style={props}>
     <Box className="carousel" sx={{width:"90vw", mx:"auto", border: 1}}>

        {[jewelry1,jewelry2,jewelry3,jewelry4,jewelry5, jewelry6].map((data) => (
          <Box
          component="img"
          sx={{
            width: "600px",
            height: "600px",
            m: 1
          }}
          alt="The house from the offer."
          src={data}
          />
        ))}

      </Box>
      </animated.div>
        {/* {[jewelry1,jewelry2,jewelry3,jewelry4,jewelry5, jewelry6].map((data) => (
          <Box
          component="img"
          sx={{
            width: "100%",
            height: "600px"
          }}
          alt="The house from the offer."
          src={data}
          />
        ))} */}
          {/* <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery6}
                />
                <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery2}
                />
                <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery3}
                />
                <Box
                component="img"
                sx={{
                  width: "600px",
                  height: "600px"
                }}
                alt="The house from the offer."
                src={jewelery4}
                /> */}

      </Box>

  )
}

export default LandingPage
